import Section from "../comps/Section";
const Index = () => (
  <Layout>
    <Section
      col={"7"}
      rest={
        "align-items-center align-content-center px-5 border-right border-gray"
      }
    >
      {" "}
    </Section>
    <Section
      col={"5"}
   
    ></Section>
  </Layout>
);

